import React from "react";
import myData from "../db.json";

const Home = () => {
  const total = myData.details;

  const renderTableData = () => {
    return total.map((data) => (
      <tr key={data.id}>
        <td>{data.id}</td>
        <td className="ip">{`${data.FirstName} ${data.LastName}`}</td>
        <td>{data.Gender}</td>
        <td>{data.DoB}</td>
        <td className="ip">{data.Email}</td>
        <td>{data.Mobile}</td>
        <td>{data.location}</td>
        {/* <button onClick={handleDelete} className="delete">
          Remove
        </button> */}
      </tr>
    ));
  };

  return (
    <div>
      <div className="table-data">
        <table>
          <thead>
            <tr>
              <th>SI.NO</th>
              <th>Name</th>
              <th>Gender</th>
              <th>DoB</th>
              <th>Email</th>
              <th>Mobile</th>
              <th>location</th>
              <th className="empty"></th>
            </tr>
          </thead>
          <tbody>{renderTableData()}</tbody>
        </table>
      </div>
    </div>
  );
};

export default Home;
